  false,\n\t\"url\": null,\n\t\"notes\": \"This management plan is for management
  of black-tailed prairie dogs on the Rainwater Basin Wetland Management District
  , Nebraska.  A management plan is needed for black-tailed prairie dogs due to health
  and safety issues and adjacent landowners. This plan includes background, historic
  management, current status, current and potential habitat, potential prairie dog
  management actions, and conflicts between Comprehensive Conservation Plan (CCP)
  management objectives.  This document also contains the Endangered Species Act -
  Section 7 Intra-Service Consultation Evaluation.\",\n\t\"license_title\": \"License
